pragma solidity >= 0.7.0 < 0.9.0;

contract Units {
    address admin;
    uint count = 0;

    constructor() {
        // msg est une variable globale et sender nous donne l'adresse de celui qui fait appel au contrat, qui fait la transaction
        admin = msg.sender;
    }

    function increment() public {
        count++;
    }
}

